import * as React from 'react';
import Paper from '@mui/material/Paper';
import {
  Scheduler,
  WeekView,
  Appointments,
  AppointmentTooltip,
  AppointmentForm,
  Toolbar,
  DateNavigator,
  ViewSwitcher,
  MonthView,
  DayView,
} from '@devexpress/dx-react-scheduler-material-ui';

import appointments from './today-appointments';
import { TodayButton, ViewState } from '@devexpress/dx-react-scheduler';

import Booking from './Booking';

export default class Demo extends React.PureComponent {
  constructor(props) {
    super(props);
    this.state = {
      data: appointments,
      editingAppointment: null, 
    };
  }

  handleAppointmentEdit = (editingAppointment) => {
    this.setState({ editingAppointment });
  };

  handleAppointmentSave = (changedAppointment) => {
    this.setState((prevState) => ({
      data: prevState.data.map((appointment) =>
        appointment.id === changedAppointment.id ? { ...appointment, ...changedAppointment } : appointment
      ),
      editingAppointment: null, 
    }));
  };

  render() {
    const { data, editingAppointment } = this.state;

  return (
    <Paper>
      {/* Render the AppointmentEditor and pass down data and onSave function */}
      <AppointmentEditor data={editingAppointment} onSave={this.handleAppointmentSave} />

      <Scheduler data={data} height={660}>
        <ViewState />
        <DayView startDayHour={9} endDayHour={19} />
        <WeekView startDayHour={9} endDayHour={19} />
        <MonthView />
        <Toolbar />
        <ViewSwitcher />
        <DateNavigator />

        <Appointments />
        {/* Update the AppointmentTooltip to use the handleAppointmentEdit function */}
        <AppointmentTooltip showCloseButton showOpenButton onOpenButtonClick={this.handleAppointmentEdit} />
      </Scheduler>
    </Paper>
  );
}
}
